        private static void Add(uint hash, VehConfig config)
        {
            if (!VehicleConfigList.ContainsKey(hash))
                VehicleConfigList.Add(hash, config);
            else
                Console.WriteLine($"{config.ModelName} добавлена в конфиги дважды");
        }
